import Link from 'next/link';

const Navbar = () => (
 <>
  <ul class="flex">
    <li class="mr-6">
      <Link href="/"><a class="text-blue-500 hover:text-blue-800" href="#">Home</a></Link>
    </li>
    <li class="mr-6">
      <Link href="about"><a class="text-blue-500 hover:text-blue-800" href="#">About</a></Link>
    </li>
  </ul>

  <style jsx>{`
    ul {
      background: #333;
      color: #fff;
      display: flex;
      flex-direction: row;
      list-style: none;
    }

    ul li {
      font-size: 18px;
      margin-right: 20px;
    }

    ul li a {
      font-family: Arial;
      color: white;
      text-decoration: none;
    }

  `}</style>
  </>
);

export default Navbar;
